import '../css/Header.css';

class Header extends Component {
    render () {
        return (
            <>
                <div class="home-details col-lg-12 col-md-8">
                    <span>HI, I'M BEN,</span>
                    <span>FRONT END DEVELOPER</span>
                    <p class="top-p col-10">User-Focused Developer with advanced skills in Javascript, HTML and CSS, amongst other languages and frameworks.</p>
                    </div>
                    <div class="home-div-button">
                    <button class="col-2 home-button select-option" data-name="work">PROJECTS</button>
                </div>
            </>    
        );
    }
}

export default Header;
